import React from 'react'
import { Link } from 'react-router-dom'

function Header() {
  return (
    <div>
        <Link to="Home"> Home </Link>
        <Link to="services"> About </Link>
        <Link to="Contact Us"> Login </Link>
        <Link to ="Register"> Register </Link>
    </div>
  );
}

export default Header
